import React from 'react'

    const Contacts = ({ contacts }) => {
      return (
        <div>
          <center><h1>Contact List</h1></center>
          {contacts.map((contact) => {
            return (<div class="card">
              <div class="card-body">
                <h5 class="card-title">{contact.id}</h5>
                <h5 class="card-subtitle mb-2 text-muted">{contact.employee_name}</h5>
                <h5 class="card-text">{contact.employee_salary}</h5>
                <h5 class="card-text">{contact.employee_age}</h5>
              </div>
            </div>);
          })}
        </div>
      )
    };

    export default Contacts;
